import React from 'react';

const Vault = () => (
  <div className="min-h-screen bg-gray-50 p-8">
    <h1 className="text-2xl font-bold mb-4">Password Vault</h1>
    <p className="mb-4">Add, edit, and manage your passwords here.</p>
    {/* TODO: Implement password CRUD UI */}
    <div className="bg-white p-6 rounded-lg shadow text-gray-500">Password list coming soon...</div>
  </div>
);

export default Vault;
